import { StyleSheet } from "react-native";

const styles = StyleSheet.create({
    container: {
        flex: 1,
    },
    ctnHeader: {
        paddingTop: 32,
        paddingHorizontal: 16,
        flexDirection: 'row',
        justifyContent: 'space-between',
        alignItems: 'center',
        marginBottom: 48
    },
    btnCancel: {
        padding: 8
    },
    textHeader: {
        fontFamily: 'Inconsolata-Bold',
        fontSize: 20
    },
    textIn: {
        fontFamily: 'Inconsolata-Bold',
        fontSize: 18
    },
    ctnRating: {
        flexDirection: 'row',
        alignItems: 'center',
        width: '100%'
    },
    ctnComment: {
        paddingVertical: 16,
        paddingHorizontal: 16,
        flexDirection: 'row',
        width: '100%'
    },
    userComment: {
        width: '10%',
        marginRight: 16
    },
    imgUserCmt: {
        width: 46,
        height: 46,
        borderRadius: 50,
        borderColor: '#ccc',
        borderWidth: 1,
    },
    ctnTextCmt: {
        width: '85%',
        height: 140,
        paddingHorizontal: 12,
        paddingVertical: 12,
        borderRadius: 20,
        borderColor: '#ccc',
        borderWidth: 1
    },
    textCmt: {
        fontFamily: 'Inconsolata-Medium',
        fontSize: 16,
        padding: 8,
        height: 60,
        lineHeight: 24
    },
    buttonSend: {
        padding: 8,
        borderRadius: 20,
        backgroundColor: '#2c5d48',
        width: 72,
        position: 'absolute',
        bottom: 12,
        right: 12
    },
    focusInput: {
        borderColor: 'blue',
        borderWidth: 0.5,
        borderRadius: 10
    },
    textInput: {
        fontFamily: 'Inconsolata-Medium',
        fontSize:18,
        color: '#fff',
        textAlign: 'center',
    }
});

export default styles;
